// SPDX-License-Identifier: MIT

// Recoge fondos de usuarios
// Te permite recoger esos fondos siendo el propietario del contrato
// Te permite establecer un valor mínimo para que te transfieran calculado en USD

pragma solidity ^0.8.8;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract FundMe {

    uint256 public minimunUSD = 50;

    function fund() public payable {
    // Queremos establecer una cantidad mínima que nos tengan que ingresar en USD
    // 1. ¿Cómo mandar ETH a este contrato? 0x8A753747A1Fa494EC906cE90E9f37563A8AF630e
        require(msg.value > minimunUSD, "Didn't send enough!!!"); // Con esto estamos haciendo que como mínimo tengan que transferir 1ETH 
        // Lo que hay entre paréntesis: El primer argumento es para seleccionar la cantidad mínima, y el segundo argumento es para que en caso de que la sentencia "require" falle, aparezca el mensaje de error
        // 18 decimales

    }

    function getPrice() public {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        (,int256 price,,,) = priceFeed.latestRoundData();
        // Esto hace referencia al precio de ETH en USD
       // return price * 1e10; // Es lo mismo que poner 1 * 10 ** 18
    } 

    function getVersion() public view returns (uint256) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        return priceFeed.version();
    }
   // function withdraw() {

    //}

}

@chainlink/contracts/src/v0.8/interfaces.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface AggregatorV3Interface {
  function decimals() external view returns (uint8);

  function description() external view returns (string memory);

  function version() external view returns (uint256);

  // getRoundData and latestRoundData should both raise "No data present"
  // if they do not have data to report, instead of returning unset values
  // which could be misinterpreted as actual reported values.
  function getRoundData(uint80 _roundId)
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );

  function latestRoundData()
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );
}

